The sides of the quadrilateral are
\[\overline{AB} = 1, \quad \overline{BC} = \sqrt{2}, \quad \overline{CD} = 1, \quad \overline{DA} = 2,\]so the length of the curve is $\boxed{4 + \sqrt{2}}.$

problem:
Link is coloring a triforce, which consists of four equilateral triangles and is depicted below. He has three colors to use: gold, black, and green. So that it remains recognizable, he doesn't want to color any two triangles the same color if they share a side. How many different ways can he color the triforce? (Two colorings that differ by rotation are considered distinct.) [asy]
size(50);
draw((0,0)--(2,0)--(1,1.732)--cycle);
draw((1,0)--(1.5,.866)--(.5,.866)--cycle);
[/asy]

gpt-4_answer:
Let's label the triangles A, B, C, and D for ease of reference, as shown below:

[asy]
size(50);
draw((0,0)--(2,0)--(1,1.732)--cycle);
draw((1,0)--(1.5,.866)--(.5,.866)--cycle);
label("$A$",(0.5,0.289),S);
label("$B$",(1.5,0.289),S);
label("$C$",(1,1.154),N);
label("$D$",(1,0.577),NE);
[/asy]

Since triangles A, B, and D share a side, they must have different colors. There are 3 color options for Triangle A. After coloring Triangle A, there are 2 color options left for Triangle B, and then just 1 color option for Triangle D.

Triangle C only shares a side with Triangle D, so it can be any of the remaining two colors.

So, there are $3 \times 2 \times 1 \times 2 = \boxed{12}$ ways to color the triforce.

