solution:
We let the $x$ axis represent the time Annie arrives, and the $y$ axis represent the time Xenas arrives.

[asy]
defaultpen(.7);

draw((0,0)--(120,0), Arrow);
draw((0,0)--(0,120), Arrow);
label("2:00", (0,0), SW);
label("2:45", (0,45), W);
label("3:15", (120,75), E);
label("2:45", (45,0), S);
label("4:00", (120,0), S);
label("4:00", (0,120), W);
fill((0,0)--(45,0)--(120,75)--(120,120)--(75,120)--(0,45)--cycle, gray(.7));
draw((120,0)--(120,120)--(0,120),dashed);
[/asy]

The shaded region represents the times that Annie and Xenas would see each other at the party.  For example, if Annie arrived at 2:00, Xenas could arrive at any time between 2:00 and 2:45 and see Annie at the party.  Let one hour equal one unit.  Then, we can calculate the area of the shaded region as the area of the entire square minus the areas of the two unshaded triangles.  This equals $$2\cdot \frac{1}{2} \cdot \frac{5}{4} \cdot \frac{5}{4}=\frac{25}{16}.$$ So the area of the shaded region is $$4-\frac{25}{16}=\frac{64-25}{16}= \frac{39}{16}.$$ Since the area of the square is 4, the probability that Annie and Xenas see each other at the party is $$\dfrac{39/16}{4} = \boxed{\dfrac{39}{64}}.$$

Let $\mathbf{a}$ be an arbitrary vector.  Let $\mathbf{p}$ be the projection of $\mathbf{a}$ onto $\mathbf{v},$ so $\mathbf{v} = \mathbf{P} \mathbf{a},$ and let $\mathbf{r}$ be the reflection of $\mathbf{a}$ over $\mathbf{v},$ to $\mathbf{r} = \mathbf{R} \mathbf{a}.$

Note that $\mathbf{p}$ is the midpoint of $\mathbf{a}$ and $\mathbf{r}.$  We can use this to find the relationship between $\mathbf{R}$ and $\mathbf{P}.$

[asy]
unitsize(1 cm);

pair D, P, R, V;

D = (3,2);
V = (1.5,2);
R = reflect((0,0),D)*(V);
P = (V + R)/2;

draw((-1,0)--(4,0));
draw((0,-1)--(0,3));
draw((0,0)--D,Arrow(6));
draw((0,0)--V,red,Arrow(6));
draw((0,0)--R,blue,Arrow(6));
draw((0,0)--P,green,Arrow(6));
draw(V--R,dashed);

label("$\mathbf{v}$", D, NE);
label("$\mathbf{p}$", P, S);
label("$\mathbf{a}$", V, N);
label("$\mathbf{r}$", R, SE);
[/asy]

Since $\mathbf{p}$ is the midpoint of $\mathbf{a}$ and $\mathbf{r},$ $\mathbf{p} = \frac{\mathbf{a} + \mathbf{r}}{2},$ so
\[\mathbf{r} = 2 \mathbf{p} - \mathbf{a}.\]In other words,
\[\mathbf{R} \mathbf{a} = 2 \mathbf{P} \mathbf{a} - \mathbf{I} \mathbf{a}.\]Since this holds for all vectors $\mathbf{a},$
\[\mathbf{R} = 2 \mathbf{P} - \mathbf{I}.\]Thus, $(a,b) = \boxed{(2,-1)}.$

