From the given information,
\begin{align*}
\angle BDA + \angle ADC &= 180^\circ - \angle CBA = 180^\circ - x, \\
\angle ADC + x &= 180^\circ - 2x.
\end{align*}Subtracting these equations, we get $\angle BDA = 3x,$ so triangles $ABC$ and $BDC$ are similar.

By the Law of Cosines on triangle $ABC,$
\[(AC)^2 = (1)^2 = (AB)^2 + (BC)^2 - 2 \cdot AC \cdot BC \cdot \cos \angle CBA = 25 + (BC)^2 - 10 \cdot BC \cdot \cos x.\]By the Law of Cosines on triangle $BDC,$
\[(BC)^2 = (DB)^2 + (DC)^2 - 2 \cdot DB \cdot DC \cdot \cos \angle BCD = (DB)^2 + (DC)^2 + 4 \cdot \cos 2x.\]Then $25 - 10 \cdot BC \cdot \cos x = (DB)^2 + (DC)^2 + 4 \cdot \cos 2x.$

From the Angle Addition Formula,
\[\cos 2x = \cos (x + x) = \cos x \cos x - \sin x \sin x = \cos^2 x - \sin^2 x.\]Also,
\[\sin^2 x = 1 - \cos^2 x.\]Hence,
\[\cos (2x) = 2 \cos^2 x - 1.\]Then
\[25 - 10 \cdot BC \cdot \cos x = (DB)^2 + (DC)^2 + 8 \cos^2 x - 4.\]Thus, $(DB)^2 + (DC)^2 + 8 \cos^2 x = 21 - 10 \cdot BC \cdot \cos x.$

Dividing the sides by $(AB)^2 = 25,$ we get
