We start by using the angle addition formula for $\sin(2A+B)$:
\begin{align*}
\frac{2\sin A \cos A \,\cos B+\sin B \,\cos (2A)}{\sin B}&=5
\end{align*}
Since $\sin B \neq 0$, we have
\begin{align*}
2\sin A \cos A \cos B+\sin B \cos(2A)&=5\sin B
\end{align*}
Now, we use the double-angle formula for $\cos(2A)$:
\begin{align*}
2\sin A \cos A \cos B+\sin B (2\cos^2 A-\sin^2 A)&=5\sin B \\
2\sin A \cos A \cos B+2\sin B \cos^2 A-\sin^3 B &= 5\sin B
\end{align*}
Rearranging and dividing by $\sin B$   (since $\sin B \neq0$), we have
\begin{align*}
\frac{2\sin A \cos A \cos B}{\sin B}-\sin^2 B &=3\cos^2 A
\end{align*}
We are trying to find $\frac{\tan (A + B)}{\tan A} = \frac{\sin(A+B)}{\cos(A+B)} \cdot \frac{\cos A}{\sin A} = \frac{\sin A \cos B+\sin B \cos A}{\cos A (\cos A \cos B-\sin A\sin B)}$. It is enough to compute the ratio of $\frac{\sin A \cos B+\sin B \cos A}{\cos A (\cos A \cos B-\sin A\sin B)}$ to $\sin A\cos A$. 

Using the angle addition formula for $\sin(2A+B)$, we have
\begin{align*}
\frac{\sin A \cos B+\sin B \cos A}{\cos A (\cos A \cos B-\sin A\sin B)}\div\frac{\sin A\cos A}=\frac{\sin A \cos B+\sin B \cos A}{(\sin A\cos A)(\frac{\cos A \cos B}{\cos A}-\frac{\sin A\sin B}{\cos A})}=1+\frac{\sin B \cos A}{\sin A \cos A \cos B-\sin^2 A \sin B \cos A}.
\end{align*}
Observe that $
\frac{\sin^2 A \cos B + \sin A\cos A \cos B\cos B}{\sin A \cos A \cos B}.
$ Subtracting this term from the numerator of our expression for $1+\frac{\sin B \cos A}{\sin A \cos A \cos B-\sin^2 A \sin B \cos A}$, we get that the thing we want to compute is equal to
$$
\frac{\sin A \cos B+\sin B \cos A}{\cos A (\cos A \cos B-\sin A\sin B)} \cdot \frac{2\sin^2 A\cos B \cos^2B}{2\sin^2 A\cos B \cos^2B}.
$$
From our previous equation $\frac{2\sin A \cos A \cos B}{\sin B}-\sin^2 B =3\cos^2 A$, we have
\begin{align*}
\frac{\sin A \cos^2 B+\sin B \cos A \cos B}{\cos A (\cos A \cos B-\sin A\sin B)} \cdot \frac{2\sin^2 A\cos B \cos^2B}{2\sin^2 A\cos B \cos^2B}
&=\frac{\frac{2\sin A \cos A \cos B}{\sin B}-\sin^2 B \cos B + \sin B \cos A \cos B}{\cos A (\cos A \cos B-\sin A\sin B)} \cdot \frac{2\sin^2 A\cos B \cos^2B}{2\sin^2 A\cos B \cos^2B} \\
&=\frac{\frac{2\sin A \cos A \cos B}{\sin B}-\cos B(\sin^2 B- \sin B \cos A)}{\cos A (\cos A \cos B-\sin A\sin B)} \cdot \frac{2\sin^2 A\cos B \cos^2B}{2\sin^2 A\cos B \cos^2B} \\
&=\frac{2\sin A\cos A\cos B}{\sin B}\cdot\frac{\sin^2 B-\cos B(\sin B \cos A+\cos B(\sin^2 A+\cos^2 A))}{\cos A (\cos A \cos B-\sin A\sin B)} \cdot \frac{2\sin^2 A\cos B \cos^2B}{2\sin^2 A\cos B \cos^2B}\\
&=\frac{\frac{2\sin A \cos A \cos B}{\sin B}}{\cos A (\cos A \cos B-\sin A\sin B)} \cdot \frac{(\sin^2 B-\cos B(\sin B \cos A+\cos B))}{\frac{2\sin A \cos A \cos B}{\sin B}} \\
&=\boxed{\frac{5}{3}}.
\end{align*}

solution:
A $90^\circ$ rotation in the clockwise direction corresponds to multiplication by $\operatorname{cis} (-90^\circ) = -i.$

[asy]
unitsize(0.4 cm);

pair O = (-4,-5), A = (3,0), B = rotate(-90,O)*(A);

draw(O--A,dashed);
draw(O--B,dashed);

dot("$3$", A, NE);
dot("$1 - 12i$", B, SE);
dot("$-4 - 5i$", O, W);
[/asy]

Let $z$ be the image of $3$ under the rotation.  Since center of the rotation is $-4 - 5i,$
\[z - (-4 - 5i) = (-i)(3 - (-4 - 5i)).\]Solving, we find $z = \boxed{1 - 12i}.$

